    <p>&nbsp;</p> 

    <p>Se realiza una investigación integral del evaluado en áreas de interés como: Situación económica, núcleo familiar, trayectoria laboral, trayectoria escolar, extracto social y datos generales, lo cual permite tener visibilidad del evaluado. </p>
    
    <p>Este servicio será de gran utilidad para procesos de: Selección de personal, Evaluación de permanencia, Promoción interna en diversos sectores como Salud, Escolar, Crediticio y Laboral. </p>

    <p>El proceso de Estudios consta de: </p>
    <ul>
        <li>Levantamiento de información a través de una visita domiciliaria o bien vía remota. </li>
        <li>Recabar y analizar la documentación básica del evaluado para determinar la veracidad de esta. </li>
        <li>Análisis información de: </li>
        <p class="sinNada">&nbsp;</p> 
        <ul class="circulo" type="circle">
            <li >Situación económica: Egresos vs ingresos, activos, capacidad de endeudamiento, y estilo de vida. </li>
            <li >Núcleo familiar: Estado civil, estructura familiar y dependientes económicos. </li>
            <li>Trayectoria laboral: Validación de referencias laborales de los últimos 5 años del evaluado incluyendo la evaluación de su jefe inmediato y Recursos Humanos.</li> 
            <li>Trayectoria escolar: Validación del último grado de estudios. </li>
            <li>Extracto social: Referencias personales, actividades independientes a temas laborales, y principales pasatiempos.</li>
            <li>Datos generales: Documentación básica del evaluado. </li>
            <li>Evidencias gráficas (Fotografías): De la vivienda y del evaluado. </li>
            <li>Croquis: Ubicación exacta del lugar de residencia del evaluado. </li>
        </ul>
        <p class="sinNada">&nbsp;</p>
        <li>Dictaminación: Entrega de un resultado Apto o No apto del evaluado con base a la matriz de riesgos de evaluación.</lo>

    </ul>
    <p>Los tiempos de respuesta son de 3 - 5 días hábiles una vez realizado el levantamiento de información ya sea de forma presencial o remota.</p>

    <p>En caso de solicitar un servicio urgente el tiempo de respuesta será no mayor a 3 días, una vez realizado el levantamiento de información ya sea de forma presencial o remota. </p>
    
    <p>El estudio es entregado en formato PDF vía correo electrónico.</p>

    <p>Nuestros procesos pueden ser adaptados a los de cada cliente para cumplir en tiempo y forma.</p>


